import React, { useState } from 'react';
import { Space, Table, Tag, Button, Modal, Input, Form } from 'antd';

const App = () => {
  const [data, setData] = useState([
    {
      key: '1',
      name: 'John Brown',
      age: 32,
      skills: 'New York No. 1 Lake Park',
      tags: ['Free', 'Busy'],
    },
    {
      key: '2',
      name: 'Jim Green',
      age: 42,
      skills: 'London No. 1 Lake Park',
      tags: ['Free', 'Busy'],
    },
    {
      key: '3',
      name: 'Joe Black',
      age: 32,
      skills: 'Sydney No. 1 Lake Park',
      tags: ['Busy', 'Free'],
    },
  ]);
  const handleDelete = (key) => {
    const newData = data.filter((item) => item.key !== key);
    setData(newData);
  };


};
